cy.request({
  method: 'POST',
  url: Cypress.config().baseUrl,
  headers: {},
  body: {
    "full_name": _apiSessionData.default.fullName,
    "lang": _apiSessionData.default.language,
    "document_country": _apiSessionData.default.documentCountry,
    "document_type": docTypeElem,
    "additionalData": {
      "isTest": false
    }
  }
}).then(res => {
  expect(res.status).to.eq(200);
  expect(res.body.sessionToken).to.be.a("string");
  expect(res.body.integrationUrl).to.eq(Cypress.env('integrationUrl'));
  cy.task('set', {
    name: 'sessionToken',
    value: res.body.sessionToken
  });
});

// Get session token  
cy.task('get', 'sessionToken').then(sessionToken => {
  sessionToken;
  cy.request({
    method: 'GET',
    url: `${Cypress.env('integrationUrl')}${Cypress.env('sessionApi')}`,
    headers: {
      'Authorization': `Bearer ${sessionToken}`
    }
  }).then(res => {
    expect(res.status).to.eq(200);
    expect(res.body.id).to.be.a("string");
    expect(res.body.status).to.deep.equal('created');
    expect(res.body.initData.language).to.deep.equal(_apiSessionData.default.language);
    expect(res.body.initData.preselectedDocument.country).to.deep.equal(_apiSessionData.default.documentCountry);
    expect(res.body.initData.preselectedDocument.type).to.deep.equal(docTypeElem);
  });
});

